import React, { useState, useEffect, useRef } from "react";
import "tailwindcss/tailwind.css";
import github from "./icons/github.png";
import behance from "./icons/behance.png";
import gmail from "./icons/gmail.png";
import linkedin from "./icons/linkedin.png";
import medium from "./icons/medium.png";

function Terminal() {
  const [command, setCommand] = useState("");
  const [output, setOutput] = useState([]);
  const [welcomeMessage, setWelcomeMessage] = useState(
    "Welcome to my portfolio! To start exploring this Terminal type <i>help</i> then press enter. Note that the Tab Key helps you complete the commands."
  );

  const terminalRef = useRef(null);

  useEffect(() => {
    terminalRef.current.scrollTop = terminalRef.current.scrollHeight;
  }, [output]);

  function handleCommand(e) {
    e.preventDefault();
    let newOutput = [...output, { command: command, output: "" }];
    switch (command.toLowerCase()) {
      case "about":
        newOutput[newOutput.length - 1].output = `My name is Fatima STAILI, I am a cybersecurity student who has had a long-standing passion for technology and security and a slight web development background, I am currently working on networking certifications. I am a bachelor student in cyber security and a member of the development department of the GDG club, based in Orleans.`;
        break;
      case "work":
        newOutput[newOutput.length - 1].output = (
          <table className="table-auto">
            <thead>
              <tr>
                <th className="px-4 py-2">Date</th>
                <th className="px-4 py-2">Entreprise</th>
                <th className="px-4 py-2">Role</th>
                <th className="px-4 py-2">Description</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td className="border px-4 py-2"></td>
                <td className="border px-4 py-2"></td>
                <td className="border px-4 py-2">Digital Mediator</td>
                <td className="border px-4 py-2"></td>
              </tr>
              <tr>
                <td className="border px-4 py-2"></td>
                <td className="border px-4 py-2"></td>
                <td className="border px-4 py-2">Assistant Chief Information Security Officer (CISO)</td>
                <td className="border px-4 py-2"></td>
              </tr>
              <tr>
                <td className="border px-4 py-2"></td>
                <td className="border px-4 py-2"></td>
                <td className="border px-4 py-2">Assistant System and Network Administrator</td>
                <td className="border px-4 py-2"></td>
              </tr>
              <tr>
                <td className="border px-4 py-2"></td>
                <td className="border px-4 py-2"></td>
                <td className="border px-4 py-2">Network Technician</td>
                <td className="border px-4 py-2"></td>
              </tr>
            </tbody>
          </table>
        );
        break;
      case "projects":
        newOutput[newOutput.length - 1].output = (
          <div>
            <h1>Projects</h1>
            <ul>
              <li><a href="https://github.com/staifathima/">My Projects on Github</a></li>
            </ul>
          </div>
        );
        break;
      case "education":
        newOutput[newOutput.length - 1].output = (
          <table className="table-auto">
            <thead>
              <tr>
                <th className="px-4 py-2">Date</th>
                <th className="px-4 py-2">University</th>
                <th className="px-4 py-2">Degree</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td className="border px-4 py-2">2017-2021</td>
                <td className="border px-4 py-2">University Jean Monnet</td>
                <td className="border px-4 py-2">Bachelor's degree in computer science</td>
              </tr>
              <tr>
                <td className="border px-4 py-2">2021-2023</td>
                <td className="border px-4 py-2">University of Orleans</td>
                <td className="border px-4 py-2">Master in Cybersecurity</td>
              </tr>
            </tbody>
          </table>
        );
        break;
      case "hobbies":
        newOutput[newOutput.length - 1].output = `I am very passionate about sports especially CrossFit. I also love reading novels, manga and sometimes comics.`;
        break;
      case "clear":
        setOutput([]);
        return;
      case "contact":
        newOutput[newOutput.length - 1].output = "staifathima@gmail.com";
        break;
      case "socials":
        newOutput[newOutput.length - 1].output = (
          <div>
            <h1>Follow me on:</h1>
            <ul className="list-none">
              <li><img className="icon" src={github} alt="github" /><a href="https://github.com/staifathima/">Github</a></li>
              <li><img className="icon" src={linkedin} alt="linkedin" /><a href="https://www.linkedin.com/in/fatima-staili/">Linkedin</a></li>
              <li><img className="icon" src={behance} alt="behance" /><a href="https://www.behance.net/staifathima/">Behance</a></li>
              <li><img className="icon" src={medium} alt="medium" /><a href="https://medium.com/@staifathima/">Medium</a></li>
            </ul>
          </div>
        );
        break;
      case "help":
        newOutput[newOutput.length - 1].output = `
          • about: learn more about me
          • contact: get my e-mail address
          • socials: how to contact me online
          • education: my academic journey
          • work: list of my work experiences
          • projects: list of my projects
          • hobbies: check out my hobbies
          • clear: clear terminal
          • get cv: download my cv
        `;
        break;
      default:
        newOutput[newOutput.length - 1].output = `Invalid command: ${command}. Please type 'help' for the list of commands.`;
        break;
    }
    setOutput(newOutput);
    setCommand("");
  }

  return (
    <div className="Terminal" ref={terminalRef}>
      <div dangerouslySetInnerHTML={{ __html: welcomeMessage }} />
      {output.map(({ command, output }) => (
        <div>
          <div className="command-line">
            <span className="prefix">$</span>
            <span className="command">{command}</span>
          </div>
          <div className="output">{output}</div>
        </div>
      ))}
      <form onSubmit={handleCommand}>
        <span className="prefix">$</span>
        <input
          type="text"
          className="terminal-input"
          value={command}
          onChange={(e) => setCommand(e.target.value)}
          autoComplete="off"
          autoFocus
        />
      </form>
    </div>
  );
}

export default Terminal;
